import React, { Component } from 'react';
import '../Styles/LandingPage.css';
import floating from '../Assets/Girl/Floating.png';

class LandingPage extends Component {
    state = {  }
    render() { 
        return (
        <div id = "landingMain">


            <div className = "innerContainer col-lg-10 col-md-10 col-sm-11">

                <div className= "landingDescription col-lg-6 col-md-6">
                    <p id = "title">Christina Bui</p>
                    <p id = "paragraph">Aspiring developer ready to enhance foundational skills that provides positive impact within the industry.</p>

                    <div className = "links">
                        <a id = "link" className="contactMe" href = "#contactForm">Contact Me</a>
                        <a id = "link" className="exploreMore" href = "#">Explore More</a>
                    </div>
                </div>

                <img className="floatingGirl col-lg-4 col-md-5 col-sm-6" src = {floating}></img>
            </div>

        </div>
        );
    }
}

export default LandingPage;
